import styled from './Meals.module.css'
const Meals = (props) => {
    return (
        <ul className={styled.meals_container}>
           {props.meals.map(meal => {
          return  <li className={styled.meal_container}><h3>{meal.name}</h3> <div className={styled.meal__description}>{meal.description}</div> {meal.price}</li>
           })}
        </ul>
    )
}
export default Meals
